    const navigate = useNavigate();

    return (
    <>
    <h1>{props.movieData.Title}</h1>
    <p>Genre:</p>
    <p>Released:</p>
    <p>Rated:</p>
    <p>Released:</p>
    <p>IMDB Rating:</p>
    <p>Director:</p>
    <p>Writer:</p>
    <p>Actors:</p>
    <div>
        <h5>About</h5>
        <p></p>
        <button href="https://www.imdb.com/title/${props.movieData.imdbID}/">View on IMDB</button>
        <button onClick={()=>{navigate('/')}}>Go Back To Search</button>
    </div>

    </>
    )

}

const mapStateToProps = (state) => {
    return {
        movieData: state.movieData || {}

    }
  }

